  return (
    <div className="gallery-popup">
        <div className="img-wrapper">
            <img src={`/assets/photos/g${imgIndex}@2x.jpg`} alt="Photo from gallery"/>
            <span className="button-wrapper">
              <button>left</button>
              <button>right</button>
            </span>
        </div>
    </div>
  )
}
export default GalleryPopup;
